import React from 'react';
import './App.css';
import './bootstrap.min.css';


class Empty extends React.Component{
	constructor(props){
		super(props);
		this.state = {
			view : []
		}
	}
	render(){
		return (
			<div>Vue empty</div>
	  );
	}	
}

export default Empty;
